import React from 'react';

interface props {
    content: string;
}

export const Button = ({ content }: props) => {
    return (
        <button className="py-2 px-4 my-28 bg-indigo-600 h-12 text-white bold font-medium rounded-md hover:bg-indigo-800 text-lg opacity-80">
            {content}
        </button>
    );
};
